description:
This is a collection of all the Chill Dojo's made famous by the Musicninja.com.  Most of the songs in it are freely available for download by the artist but I figured I would make an amalgamated collection complete with correct file names and high quality mp3s, as well as the artists names which often aren't listed.  The music is highly varied with a good smattering of chillout, ambient, chillstep, dubstep, electro, mashups, etc. 
